Le Jiangnan (chinois : 江南 ; pinyin : jiāngnán ; littéralement : « Sud du fleuve (sous entendu Changjiang) », autrefois écrit en occident Kiang-nan) est une région géographique proche de Shanghai en République populaire de Chine. Majoritairement agricole, elle comporte de nombreux villages traversés par des rivières et de petits canaux. Les plus anciens, comme Zhouzhuang ou Suzhou, ont plus de 2500 ans. La culture Wu domine le Jiangnan. Les habitants parlent des topolectes différents du mandarin, regroupés sous le nom de Wu. Ceux-ci incluent les dialectes de Suzhou, Shanghai, Zhenjiang, Wuxi, Hangzhou. La région est devenue un foyer culturel important dès la dynastie Han au IIe siècle apr. J.-C. La région s'articule aujourd'hui autour d'un pôle économique important, celui-ci étant le triangle économique du delta du Yangtze. Quelques-uns des villes et villages célèbres du Jiangnan : 
*  Changshu (常熟 Chángshú) ; 
*  Hangzhou (杭州 Hángzhōu), chef-lieu du Zhejiang ; 
*  Nankin (南京, Nánjīng traduit par Nankin en français), autrefois capitale de la Chine ; 
*  Nanxun (南浔 Nánxún), chef-lieu d'un district de la ville de Huzhou ; 
*  Shanghai (上海, Shànghǎi), une des plus grandes villes de Chine ; 
*  Suzhou (苏州 Sūzhōu) aujourd'hui grande ville industrielle ; 
*  Wuxi (无锡 Wúxī), province du Jiangsu ; 
*  Wuzhen (乌镇 Wūzhèn), village ayant plus de 5 000 ans d'histoire, province du Zhejiang ; 
*  Xitang (西塘 Xītáng) ; 
*  Yangzhou (扬州 Yángzhōu) ; 
*  Zhouzhuang (周庄 Zhōuzhuāng) baptisée la Venise orientale en raison de ses canaux.
